PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "contacts_backup" (
              id INTEGER PRIMARY KEY AUTOINCREMENT,
              first_name TEXT NOT NULL,
              last_name TEXT NOT NULL,
              email TEXT NOT NULL UNIQUE,
              current_carrier TEXT NOT NULL,
              plan_type TEXT NOT NULL,
              effective_date TEXT NOT NULL,
              birth_date TEXT NOT NULL,
              tobacco_user INTEGER NOT NULL,
              gender TEXT NOT NULL,
              state TEXT NOT NULL,
              zip_code TEXT NOT NULL,
              agent_id INTEGER,
              last_emailed DATETIME,
              phone_number TEXT NOT NULL DEFAULT '',
              status TEXT NOT NULL DEFAULT '',
              created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
              updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
            );
CREATE TABLE IF NOT EXISTS leads (
              id INTEGER PRIMARY KEY AUTOINCREMENT,
              name TEXT NOT NULL,
              email TEXT NOT NULL,
              created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
              UNIQUE(email)
            );
CREATE TABLE IF NOT EXISTS "contacts" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    email TEXT NOT NULL UNIQUE,
    current_carrier TEXT, 
    current_premium TEXT, 
    plan_type TEXT, 
    effective_date TEXT, 
    birth_date TEXT, 
    tobacco_user INTEGER NOT NULL DEFAULT 0,
    gender TEXT, 
    state TEXT, 
    zip_code TEXT, 
    agent_id INTEGER,
    last_emailed DATETIME,
    phone_number TEXT, 
    status TEXT NOT NULL DEFAULT '',
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
, aep_request BOOLEAN DEFAULT FALSE, aep_request_date DATETIME);
CREATE TABLE IF NOT EXISTS "eligibility_answers" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    contact_id INTEGER NOT NULL,
    quote_id TEXT NOT NULL,
    answers TEXT NOT NULL,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "contact_events" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    contact_id INTEGER,
    lead_id INTEGER,
    event_type TEXT NOT NULL,
    metadata TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE,
    FOREIGN KEY (lead_id) REFERENCES leads(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "tracking_clicks" (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  tracking_id TEXT NOT NULL,
  contact_id INTEGER,
  quote_id TEXT,
  clicked_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS batches (
    id TEXT PRIMARY KEY NOT NULL,
    org_id INTEGER NOT NULL,
    message_type TEXT NOT NULL,
    send_mode TEXT NOT NULL CHECK(send_mode IN ('test', 'production')),
    channels TEXT NOT NULL,
    test_email TEXT,
    status TEXT NOT NULL CHECK(status IN ('scheduled', 'in_progress', 'paused', 'completed', 'failed')) DEFAULT 'scheduled',
    created_at TEXT NOT NULL,
    updated_at TEXT NOT NULL,
    contact_count INTEGER NOT NULL DEFAULT 0,
    processed_count INTEGER NOT NULL DEFAULT 0,
    error_message TEXT
);
CREATE TABLE IF NOT EXISTS batch_contacts (
    batch_id TEXT NOT NULL,             -- Foreign key to batches.id
    contact_id INTEGER NOT NULL,        -- Foreign key to contacts.id (assuming contact IDs are integers)
    PRIMARY KEY (batch_id, contact_id),
    FOREIGN KEY (batch_id) REFERENCES batches(id) ON DELETE CASCADE,
    FOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS batch_logs (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    batch_id TEXT NOT NULL,
    timestamp TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
    log_level TEXT NOT NULL DEFAULT 'INFO' CHECK(log_level IN ('INFO', 'WARN', 'ERROR')), -- e.g., INFO, WARN, ERROR
    message TEXT NOT NULL,
    FOREIGN KEY (batch_id) REFERENCES batches(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS email_send_tracking (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  org_id INTEGER NOT NULL,
  contact_id INTEGER NOT NULL,
  email_type TEXT NOT NULL,
  scheduled_date TEXT NOT NULL,
  send_status TEXT NOT NULL CHECK(send_status IN ('pending', 'processing', 'accepted', 'delivered', 'sent', 'deferred', 'bounced', 'dropped', 'failed', 'skipped')) DEFAULT 'pending',
  send_mode TEXT NOT NULL CHECK(send_mode IN ('test', 'production')) DEFAULT 'test',
  test_email TEXT,
  send_attempt_count INTEGER NOT NULL DEFAULT 0,
  last_attempt_date TEXT,
  last_error TEXT,
  batch_id TEXT NOT NULL,
  message_id TEXT,
  delivery_status TEXT,
  status_checked_at TEXT,
  status_details TEXT,
  created_at TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
  updated_at TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (contact_id) REFERENCES contacts(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS deleted_contacts (
    original_contact_id INTEGER NOT NULL, -- The ID from the original 'contacts' table
    first_name TEXT, -- Made nullable as they might be empty in original
    last_name TEXT,  -- Made nullable
    email TEXT NOT NULL, -- Crucial for billable count
    current_carrier TEXT,
    plan_type TEXT,
    effective_date TEXT,
    birth_date TEXT,
    tobacco_user INTEGER,
    gender TEXT,
    state TEXT,
    zip_code TEXT,
    agent_id INTEGER,
    phone_number TEXT,
    -- Include any other fields from 'contacts' you want to preserve historically
    deleted_at DATETIME DEFAULT CURRENT_TIMESTAMP NOT NULL
    -- No primary key on original_contact_id + email to allow multiple deletions if a user is re-added and deleted again
    -- though the billing logic will only count the most recent deletion within 12 months.
    -- A new unique ID for this table might be useful if needed:
    -- id TEXT PRIMARY KEY DEFAULT (hex(randomblob(16)))
);
CREATE TABLE IF NOT EXISTS "email_schedules" (id INTEGER PRIMARY KEY AUTOINCREMENT, contact_id INTEGER NOT NULL, email_type TEXT NOT NULL, scheduled_send_date TEXT NOT NULL, scheduled_send_time TEXT NOT NULL DEFAULT '08:30:00', status TEXT NOT NULL DEFAULT 'scheduled', skip_reason TEXT, created_at TEXT NOT NULL DEFAULT (datetime ('now')), updated_at TEXT NOT NULL DEFAULT (datetime ('now')), batch_id TEXT, event_year INTEGER, event_month INTEGER, event_day INTEGER, catchup_note TEXT, actual_send_datetime TEXT, priority INTEGER DEFAULT 10, campaign_instance_id INTEGER REFERENCES campaign_instances (id), campaign_type TEXT, trigger_date TEXT, email_template TEXT, sms_template TEXT, scheduler_run_id TEXT, metadata TEXT, FOREIGN KEY (contact_id) REFERENCES contacts (id) ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS campaign_types (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT UNIQUE NOT NULL, description TEXT, target_all_contacts BOOLEAN DEFAULT FALSE, days_before_event INTEGER NOT NULL, pre_window_exclusion_days INTEGER DEFAULT 0, post_window_days INTEGER DEFAULT 0, state_exclusions TEXT, priority INTEGER DEFAULT 10, email_template TEXT, sms_template TEXT, created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS campaign_instances (id INTEGER PRIMARY KEY AUTOINCREMENT, campaign_type_id INTEGER NOT NULL, name TEXT NOT NULL, description TEXT, active_start_date DATE NOT NULL, active_end_date DATE NOT NULL, targeting_criteria TEXT, override_email_template TEXT, override_sms_template TEXT, created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY (campaign_type_id) REFERENCES campaign_types (id));
CREATE TABLE IF NOT EXISTS contact_campaigns (id INTEGER PRIMARY KEY AUTOINCREMENT, contact_id INTEGER NOT NULL, campaign_instance_id INTEGER NOT NULL, trigger_date DATE NOT NULL, enrolled_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, status TEXT DEFAULT 'active', metadata TEXT, FOREIGN KEY (campaign_instance_id) REFERENCES campaign_instances (id), UNIQUE (contact_id, campaign_instance_id));
CREATE TABLE IF NOT EXISTS campaign_change_log (id INTEGER PRIMARY KEY AUTOINCREMENT, campaign_instance_id INTEGER NOT NULL, change_type TEXT NOT NULL, old_values TEXT, new_values TEXT, changed_by TEXT, changed_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY (campaign_instance_id) REFERENCES campaign_instances (id));
CREATE TABLE IF NOT EXISTS scheduler_checkpoints (id INTEGER PRIMARY KEY AUTOINCREMENT, scheduler_run_id TEXT UNIQUE NOT NULL, run_type TEXT NOT NULL, status TEXT DEFAULT 'started', started_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, completed_at TIMESTAMP, contacts_processed INTEGER DEFAULT 0, emails_scheduled INTEGER DEFAULT 0, emails_skipped INTEGER DEFAULT 0, errors_count INTEGER DEFAULT 0, metadata TEXT);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_contacts_email ON "contacts_backup"(email);
CREATE INDEX idx_contacts_agent_id ON "contacts_backup"(agent_id);
CREATE INDEX idx_contacts_status ON "contacts_backup"(status);
CREATE TRIGGER update_contacts_timestamp AFTER UPDATE ON "contacts_backup" BEGIN UPDATE "contacts_backup" SET updated_at = CURRENT_TIMESTAMP WHERE id = NEW.id; END;
CREATE INDEX idx_leads_email ON leads(email);
CREATE UNIQUE INDEX idx_contacts_email_unique ON "contacts_backup"(LOWER(TRIM(email)));
CREATE INDEX idx_contacts_zip_code ON contacts(zip_code);
CREATE INDEX idx_contacts_state ON contacts(state);
CREATE INDEX idx_contacts_created_at ON contacts(created_at);
CREATE INDEX idx_contacts_updated_at ON contacts(updated_at);
CREATE INDEX idx_contact_events_contact_id ON contact_events(contact_id);
CREATE INDEX idx_contact_events_lead_id ON contact_events(lead_id);
CREATE INDEX idx_contact_events_type ON contact_events(event_type);
CREATE INDEX idx_eligibility_answers_contact_id ON eligibility_answers(contact_id);
CREATE INDEX idx_contacts_aep_request ON contacts(aep_request);
CREATE INDEX idx_tracking_clicks_tracking_id ON tracking_clicks(tracking_id);
CREATE INDEX idx_tracking_clicks_contact_id ON tracking_clicks(contact_id);
CREATE INDEX idx_tracking_clicks_clicked_at ON tracking_clicks(clicked_at);
CREATE INDEX idx_email_tracking_batch_id ON email_send_tracking(batch_id);
CREATE INDEX idx_email_tracking_send_status ON email_send_tracking(send_status);
CREATE INDEX idx_email_tracking_send_mode ON email_send_tracking(send_mode);
CREATE INDEX idx_email_tracking_contact_id ON email_send_tracking(contact_id);
CREATE INDEX idx_email_tracking_contact_type ON email_send_tracking(contact_id, email_type);
CREATE INDEX idx_email_tracking_status_date ON email_send_tracking(send_status, scheduled_date);
CREATE INDEX idx_email_tracking_message_id ON email_send_tracking(message_id);
CREATE INDEX idx_email_tracking_delivery_status ON email_send_tracking(delivery_status);
CREATE TRIGGER update_email_tracking_timestamp AFTER UPDATE ON email_send_tracking BEGIN UPDATE email_send_tracking SET updated_at = CURRENT_TIMESTAMP WHERE id = NEW.id; END;
CREATE INDEX idx_deleted_contacts_email ON deleted_contacts (LOWER(TRIM(email)));
CREATE INDEX idx_deleted_contacts_deleted_at ON deleted_contacts (deleted_at);
CREATE INDEX idx_deleted_contacts_original_id ON deleted_contacts (original_contact_id);
CREATE INDEX idx_deleted_contacts_email_org ON deleted_contacts (LOWER(TRIM(email)));
CREATE INDEX idx_email_schedules_date_time_status ON email_schedules (scheduled_send_date, scheduled_send_time, status);
CREATE UNIQUE INDEX idx_email_schedules_unique ON email_schedules (contact_id, email_type, scheduled_send_date);
CREATE INDEX idx_email_schedules_org_contact ON email_schedules (contact_id);
CREATE INDEX idx_email_schedules_org_send_date ON email_schedules (scheduled_send_date);
CREATE INDEX idx_email_schedules_status ON email_schedules (status);
CREATE TRIGGER update_email_schedules_updated_at
AFTER UPDATE ON email_schedules
FOR EACH ROW
BEGIN
    UPDATE email_schedules
    SET updated_at = CURRENT_TIMESTAMP
    WHERE id = OLD.id;
END;
CREATE INDEX idx_email_schedules_event_date ON email_schedules (event_year, event_month, event_day);
CREATE INDEX idx_contact_events_event_type ON contact_events (event_type);
CREATE INDEX idx_contact_events_eligibility_check ON contact_events (contact_id, event_type, created_at DESC);
CREATE INDEX idx_contact_events_created_at ON contact_events (created_at);
CREATE INDEX idx_email_schedules_org_send_time ON email_schedules (scheduled_send_time);
CREATE INDEX idx_campaign_instances_dates ON campaign_instances (active_start_date, active_end_date);
CREATE INDEX idx_contact_campaigns_contact ON contact_campaigns (contact_id);
CREATE INDEX idx_contact_campaigns_campaign ON contact_campaigns (campaign_instance_id);
CREATE INDEX idx_contact_campaigns_trigger ON contact_campaigns (trigger_date);
CREATE INDEX idx_campaign_change_log_campaign ON campaign_change_log (campaign_instance_id);
CREATE INDEX idx_scheduler_checkpoints_run_id ON scheduler_checkpoints (scheduler_run_id);
CREATE INDEX idx_email_schedules_priority ON email_schedules (priority);
CREATE INDEX idx_email_schedules_campaign_instance_id ON email_schedules (campaign_instance_id);
CREATE INDEX idx_email_schedules_campaign_type ON email_schedules (campaign_type);
CREATE INDEX idx_email_schedules_scheduler_run ON email_schedules (scheduler_run_id);
CREATE INDEX idx_email_schedules_scheduler_run_id ON email_schedules (scheduler_run_id);
CREATE UNIQUE INDEX idx_email_schedules_unique_event ON email_schedules (contact_id, campaign_type, strftime ('%Y', trigger_date));
COMMIT;
