INSERT INTO eligibility_answers VALUES(1,1,'206-1-1cda5d68','{"1":{"question_text":"Have you ever been diagnosed with or treated for any heart condition, including but not limited to heart failure, coronary artery disease, angina, atrial fibrillation, or heart valve problems?","question_type":"main","answer":false},"2":{"question_text":"Have you ever been diagnosed with or treated for a chronic lung condition such as COPD, emphysema, chronic bronchitis, or cystic fibrosis?","question_type":"lung_health","answer":false},"3":{"question_text":"Have you ever been diagnosed with or treated for cancer, leukemia, or lymphoma (excluding basal cell skin cancer)?","question_type":"cancer_history","answer":false},"4":{"question_text":"Have you ever been diagnosed with diabetes that has resulted in any complications affecting your eyes (retinopathy), nerves (neuropathy), kidneys (nephropathy), circulation (vascular disease), or heart?","question_type":"diabetes_with_complications","answer":false},"5":{"question_text":"Do you have any concerns about your memory, thinking, or cognitive function, OR have you ever been diagnosed with dementia, Alzheimer''s disease, or any other cognitive impairment?","question_type":"memory_or_cognitive_health","answer":false},"6":{"question_text":"In the past 2 years, have you been hospitalized overnight in a hospital more than two times for any medical condition (excluding planned surgeries)?","question_type":"recent_and_current_hospitalizations","answer":false},"7":{"question_text":"Are you currently hospitalized or waiting on results from a medical test, or been recommended by a doctor to have a medical test performed?","question_type":"lung_health","answer":false}}','2025-04-26 12:10:23');
